import React, {useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { postData } from './action';
import { useNavigate } from 'react-router-dom';
export const Post = () => {
  const dispatch=useDispatch()
  const {post}= useSelector((state)=>state.user)
  const navigate=useNavigate();
  useEffect(()=>{
    dispatch(postData())},[]
  )
  return (
    <div key={post.id} style={{display:"grid", gridTemplateColumns:"1fr 1fr 1fr 1fr 1fr"}}>{post.map((item,index)=>{return( <div style={{ border:"solid 1px black"}}>
    <p> {item.id}</p>
    <p> {item.title}</p>
    <p> {item.body}</p>
    <p> {item.email}</p>
    <button onClick={()=>navigate("usercomment")}>comment</button>
    </div>)})}</div>
  )
}
